import React from "react";
import "bootstrap/dist/js/bootstrap.bundle.min.js";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav className="px-4">
      <ul className="">
        <li className="">
          <Link className="" to="/">
            Dashboard
          </Link>
        </li>
        <li className="">
          <Link className="" to="/aboutus">
            About Us
          </Link>
        </li>
        <li className="">
          <Link className="" to="/ourteam">
            Staff
          </Link>
          <Link className="" to="/services">
            Services
          </Link>
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
